    <div className="page">
  <Header />
  <Main />
  <Footer />



  <div className="popup popup-avatar">
    <div className="popup__container" id="popup-avatar-container">
      <button className="popup__close-button" id="avatar-edit-close" type="button" />
      <h2 className="popup__title">Обновить аватар</h2>
      <form className="popup__form popup__form_avatar" name="popup-avatar-form" noValidate>
        <input type="url" name="link" className="popup__form-field popup__form-field_type_link" placeholder="Ссылка на картинку" id="popup-avatar-link" required autoComplete="off" />
        <span id="popup-avatar-link-error" className="popup__form-field-error" />
        <button className="popup__submit-button" type="submit">Обновить</button>
      </form>
    </div>
  </div>
  <div className="popup popup-image">
    <div className="popup-image__container">
      <button className="popup__close-button" id="image-close" type="button" />
      <img className="popup-image__pic" alt="/" src="/" />
      <h3 className="popup-image__caption" />
    </div>
  </div>
</div>

  );
}

export default App;
